import React, { Component } from 'react';

class Home extends Component {

    render() {
        return (
            <div className="col-sm-3 sidenav">
      <h4>Create user</h4>
     <div className="input-group">
     <form >
                <input type="text" placeholder="Enter username" className="login-input form-control"  onChange={this.methodLogin.bind(this)}/>
                <input type="password" placeholder="Enter password" className="login-input form-control"/>
                <button type="submit" className="btn btn-success">Submit</button>
     </form>
      </div>
    </div>
        )
    }
}

export default Home;
